import './App.css';
import './Components/InfoDisplay';
import Display, { DisplayFastFacts, DisplayFullFacts } from './Components/InfoDisplay';

function App() {
  return (
    <div className="App">

        <div className="info">
          <DisplayFastFacts></DisplayFastFacts>
          <DisplayFullFacts></DisplayFullFacts>
        </div>
    </div>
  );
}
export default App;
